w:r.w:t:
A system of information and hardware technology that allows the
operation of the clinical laboratory process without significant
operator intervention;

  a) The LIS interfaces directly with the LAS to communicate
patient, visit, container, test orders, specimen status, and
results about specific testing to be done;

b)  Instrument or specimen processing and handling devices may be
interfaced with the LIS or the LAS to direct specific testing and
to retrieve results for reporting;

The substance may still be referred to as a specimen if it has been
processed from the obtained specimen; thus, examples of specimens
include whole blood and serum or plasma prepared from whole blood;
saliva;

The definition assumes hierarchical nesting using the
        following phrases: container is located in a carrier;
        carrier is located in a tray.
